function Header() {
  return (
    <header className="ko-header">
        <h1>Ko-Tyat-Ki Kollektiv.</h1>
        <menu>
          <li><a href="#contacts">contacts</a></li>
          <li><a href="#team">team</a></li>
          <li><a href="#about">about us</a></li>
        </menu>
      </header>
  );
}

export default Header;
